function App() {
  return (
   <>
    <h1>Welcome to My App</h1>
    <p>This is a simple React application.</p>
    <button onClick={() => alert('Button clicked!')}>Click Me</button>
    <footer>
      <p>&copy; 2023 My App</p>
    </footer>
    <style jsx>{`
      h1 {
        color: #333;    
        text-align: center;
      }
      p {
        font-size: 1.2em;
        text-align: center;
      }
      button {
        background-color: #007bff;
        color: white;
        border: none;
        padding: 10px 20px;
        cursor: pointer;
      }
      button:hover {
        background-color: #0056b3;
      }
      footer {
        text-align: center;
        margin-top: 20px;
      }
    `}</style>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/




5.15.4/css/all.min.css" />
    <script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.16.0/umd/popper.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/bootstrap/4.5.2/js/bootstrap.min.js"></script>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/bootstrap/4.5.2/css/bootstrap.min.css" />
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react/17.0.2/umd/react.production.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react-dom/17.0.2/umd/react-dom.production.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react-router-dom/5.2.0/react-router-dom.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/axios/0.21.1/axios.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/moment.js/2.29.1/moment.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/lodash.js/4.17.20/lodash.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/uuid/8.3.2/uuid.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/clipboard.js/2.0.6/clipboard.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/axios-hooks/2.0.0/axios-hooks.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react-query/3.34.0/react-query.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react-toastify/7.0.3/react-toastify.min.js"></script>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/react-toastify/7.0.3/ReactToastify.min.css" />
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react-select/4.3.1/react-select.min.js"></script>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/react-select/4.3.1/react-select.min.css" />
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react-datepicker/3.4.1/react-datepicker.min.js"></script>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/react-datepicker/3.4.1/react-datepicker.min.css" />
    <script src="https://cdnjs.cloudflare.com/ajax/libs/react-bootstrap/1.4.0/react-bootstrap.min.js"></script>

   </>
  );
}

export default App;
